  false,\n\t\"url\": null,\n\t\"notes\": \"Volunteers worked with staff to survey
  for and treat 17 different invasive species within the Willamette Valley Refuges
  (Ankeny, Baskett Slough and William L. Finley). 75 % of the mature tansey ragwort
  plants were removed prior to seed dispersal 45 miles of roadsides/trails were mechanically/chemically/hand
  treated for multiple invasive species Meadow knapweed chemical treatments were considered
  80% effective False brome was almost eradicated but most importantly prevented from
  spreading Oxeye daisy hand pulling prevented spread but was ineffective as eradication
  Hand pulling English ivy 95% eradication where treated\",\n\t\"license_title\":
